import MainScreen from './screens/MainScreen'
import { Routes, Route } from "react-router-dom";

function App() {
  return (
    <>

      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index element={<Home />} />

        </Route>
      </Routes>

      <div className="App">
        <MainScreen />
      </div>
    </>
  );
}

export default App;
